INSERT INTO `campaign` (`campaignId`, `headerImage`, `titleImage`, `title`, `campaignHeroImage`, `description`, `campaignType`, `sequence`) VALUES
(11, '1658225282_9834.png', '1658225282_7233.jpg', ' Ullas', '1658226065_8493.jpg', 'A synonym of glee that ooze out clearly in our Ullas campaign. A collection curated to let you celebrate your precious moments feeling on top of the world. A minimal yet exquisite outfit to brighten up your event and make an lasting impression. Relish your ceremonies adorning our effortless attires.', 'Instagram', 4),
(13, '1659165605_5165.jpg', '1658481717_6251.jpg', 'Anant', '1658481717_3994.jpg', 'Raising the bar with our glorious collection. A campaign filled with infinite beauty of nature and giving you a sense of euphoria. Bringing timeless creations with extraordinary silhouette to outshine the crowd. The ensembles that reflect the Indian craftsmanship and modern grace and that will surely put you in spotlight.', 'Enquiry', 2),
(14, '1658913771_8803.png', '1658913771_1097.jpg', 'Aavaas', '1658913771_2655.jpg', 'A collection that gives you a homely feeling while delivering the jaw-dropping designs and silhouettes. A collection curated for all the men that wants to stay connected to Indian roots yet giving a touch of modernness for every events. Celebrating Indianness while making a fashion statement. ', 'Enquiry', 3),
(15, '1672221598_3896.jpg', '1672221598_9972.jpg', 'NAYAB', '1672221598_4279.jpg', 'Nayab defines the uniqueness yet the richness, embedded in our new collection. Wedding ceremonies happen once in life and having a fresh take on this new collection but tapping on a royal vibe is important too. Hence the designs will be curated accordingly.\r\n', 'Enquiry', 1);

